column8:
COBとLEDの2種類の光源<br>
面発光で全体を照らす（明るさ2段階）<br>

懐中電灯としてピンポイントを照射<br>
背面マグネットで取り付け<br>
360度回転するフック<br>

マグネットで冷蔵庫に貼り付けて急な停電時に<br>
回転するフックでクローゼットや物置の灯りに<br>
